    userPoolId: 'ap-northeast-1_JFBzKeSlw',
    userPoolWebClientId: '7kg7iakih0i1jlr614hp62djeq',
    oauth: {
      domain: 'maketfeasy.auth.ap-northeast-1.amazoncognito.com',
      scope: ['openid'],
      redirectSignIn: 'https://localhost:3000/',
      redirectSignOut: 'https://localhost:3000/',
      responseType: 'code'
    }
  }
})


